/* Sky texture image by Patrick Hoesly (flickr.com/people/zooboing/) */
/* AGENT_SHEET */
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix("https://userstyles.org/"), url-prefix("https://kinda-static.userstyles.org/") {
/* url-prefix("http://userstyles.org.nyud.net/") */

html { background: #acf !important; }
body { box-shadow: 0 0 16px #8bd !important; }
.ad, #social, #post-install-ad { display: none !important; }

th, mark { background: none !important; }
body, #main-header, #left-sidebar > nav, #left-sidebar > footer, #left-sidebar > div, .listing-no-screenshot, pre, blockquote { background: rgba(250,250,250,0.5) !important; }
#left-sidebar > form, form[action="/styles/create"]:before, form[action="/styles/update"]:before { background: rgba(250,250,250,0.9) !important; }
#obsoletion-message, .notice, .errorExplanation { background: rgba(255,210,210,0.6) !important; }
option, #view-code, #lightbox > div, /*login*/a.btn-auth { background: rgba(230,230,230,0.99) !important; }
article.good-rating { background: rgba(153,255,153,0.7) !important; } /*also try: rgba(77,255,77,0.25)*/
article.ok-rating, .style-warning { background: rgba(255,255,110,0.3) !important; }
article.bad-rating { background: rgba(255,210,210,0.4) !important; }
article.no-rating { background: rgba(255,255,255,0.3) !important; }
#main-article > article { border-radius: 7px !important; }
#screenshots img { background: #8bd !important; }

.install-status.install { background-color: #9f9 !important; }
.install-status.no-install { background-color: #f99 !important; }
.install-status.install-info { background-color: #acf !important; }
.install-status.install:hover { background-color: #6e6 !important; border-color: #0f0 !important; }
.install-status.no-install:hover { background-color: #e66 !important; border-color: #f00 !important; }
.install-status.install-info:hover { border-color: #09f !important; }

* { color: inherit !important; border-color: #8bd !important; }
html { color: #111 !important; }
a, h1, h2 { color: #158 !important; text-shadow: none !important; text-decoration: none !important; }
a:visited { color: #57a !important; }
a:hover { color: #09f !important; }

hr { height: 0 !important; border-style: solid !important; border-width: 1px 0 0 !important; }
::-moz-selection { background: #57a !important; color: #fff !important; }
::selection { background: #57a !important; color: #fff !important; }

#view-code { border-color: #8bd !important; }
code, pre { border-color: #09f !important; }
.author-styles > tbody > tr:hover { outline: 1px solid #8bd !important; }
#main-header > h1:before { color: #fff !important; background: #8bd !important; }

input[type="submit"], input[type="button"], input[type="file"], input[type="reset"], button,
.install-status, #show-button { color: #158 !important; background: rgba(255,255,255,0.6) !important; border: 1px solid #8bd !important;
border-radius: 7px !important; box-shadow: none !important; text-shadow: none !important;
background-image: linear-gradient(rgba(255,255,255,0.2),rgba(125,175,225,0.2),rgba(16,80,128,0.2)) !important; }

input[type="submit"]:hover, input[type="button"]:hover, input[type="file"]:hover, input[type="reset"]:hover, button:hover, #show-button:hover
{ background-color: #48e !important; color: #fff !important; border-color: #158 !important; }

button, input, select, textarea { -moz-appearance: none !important; }
input[type="radio"], input[type="checkbox"] { color: #158 !important; background: #fff !important; border-color: #444 !important; }

input, select, textarea, input[type="text"] { background: rgba(235,235,235,0.6) !important; color: #111 !important; border: 1px solid #8bd !important; padding: 2px !important; }
input[type] { border-width: 1px !important; border-style: solid !important; }
textarea:hover, input:hover { border-color: #4ae !important; }
textarea:focus, input:focus { border-color: #09f !important; }
select > button { background-color: transparent !important; border: none !important; box-shadow: none !important; }
html:root option:checked { background: #57a !important; color: #fff !important; }


/* sky texture image (flickr.com/photos/zooboing/4099287885/) */
html { background-image: url("data:image/jpeg;base64,") !important; }

}
